let TernaryCompare = class {
  constructor(condition, ifTrue, ifFalse) {
    this.condition = condition
    this.ifTrue = ifTrue
    this.ifFalse = ifFalse
  }

  compare() {
    return this.condition ? this.ifTrue : this.ifFalse
  }
}

